  margin-right: 5px;
  padding: 0 10px;
`;

const MyMenu = () => {
  const [isLoggedIn, setIsLoggedIn] = useState(true);

  return isLoggedIn ? (
    <Row>
      <>
        <Col span={4}> ICON </Col>
        <Col span={20}> CONTENT </Col>
      </>
    </Row>
  ) : (
    <div>login 필요</div>
  );
};

export default MyMenu;
